import axios from "axios";

type Album = {
    userId: number,
    id: number,
    title: string,
}

const fetchAlbum = async () => {
    const result = await axios.get<Album[]>("https://jsonplaceholder.typicode.com/albums");
    return result.data;
}

export const AlbumList = () => {
    return (
        <div>
            <h2>アルバム</h2>
        </div>
    )
}
